import styled from 'styled-components';

export const Head3 = styled.h3`
	margin:    7rem 0 3rem 0;	
	font-size: 2rem;
	color: var(--white);
	font-weight: 1000;
	@media (max-width: 768px) {
    flex-direction: column;
    font-size: 2em;
`;
